window.bookSummaryJSON = "<p><b>She needs a fake boyfriend, and he's all in—until pretending feels a little too real…</b></p> <p><b>Audrey</b></p> <p>To my mother, a woman's value is her engagement ring, and she picked my future husband when I was sixteen… and I don't want him.</p> <p>So when my brother's week-long cruise turns into a setup, I lie. I tell her I have a boyfriend.</p> <p>The problem? I don't. Enter Colt Hayes, my unexpected hero who agrees to play along.</p> <p>But as fake touches blur into real feelings, I wonder—does he feel it too?</p> <p><b>Colt</b></p> <p>I'm the last single Hayes brother, and after a near-death experience, I want what my brothers have: a family.</p> <p>Then Audrey asks me to play her boyfriend for a week. It's easy at first… until it's not. What started as a favor is now something I can't shake.</p> <p>Everything would be perfect—if only we weren't chasing different dreams.</p> <p><i>A swoon-worthy fake-dating romance full of sparks and surprises. No cliffhangers—just a steamy, heartwarming ride.</i></p>"; 
